import React from 'react'
import { Link } from 'react-router-dom'

class Home extends React.Component {
  render(){
    return(
      <div>
        <Link to="/game">Game Start</Link>
        <Link to="/feedback">Feedback to Developer</Link>
      </div>
    )
  }
}

export default Home;
